import React from 'react';
import ReactJson from 'react-json-view';
import myData from '../backend/trie';

var arr = [];
Object.keys(myData).forEach(function(key) {
	arr.push(myData[key]);
});

const VisualSide = () => (
	<>
	{arr.map(key => (
		<li>
			{key}
		</li>
	))}
	// <ReactJson src={myData}/>
	</>
)

export default VisualSide;
